webpackJsonp([0x9fb8fd47b4f1],{640:function(e,t){e.exports={data:{site:{siteMetadata:{title:"aendrew.com v8",author:"Aendrew Rininsland"}},markdownRemark:{id:"/Users/andrew.rininsland/Projects/OTHER/aendrew.github.io/src/pages/2013-03-10-new-project-github-pages-drupal-7-also-im-git-vetted/index.md absPath of file >>> MarkdownRemark",html:'<p>Over the last few months working with Drupal, I’ve wanted to become a more productive member of the community. To that end, I’ve been working on getting a full project approved in order to get “Git vetted” and thus be able to create full projects on Drupal.org.</p>\n<p><a href="http://drupal.org/node/1914740">A bunch of work, six code reviews and a boatload of PAReview’ing later</a>, I now have full project access and have started by creating GitHub Pages, which allows users to post copies of individual nodes to <a href="http://pages.github.com">GitHub’s free HTML page hosting service</a>. This is a core bit of functionality for <a href="http://vizcloud.org">VizCloud</a>, intended to reduce server load on high-traffic nodes (For instance, a data visualization embedded in a news article).</p>\n<p>Let me know if you like it or have any comments! I need to refine it a bunch still too — and absolutely love it when people submit patches in the issue queue.</p>\n<h2><a href="http://www.drupal.org/project/ghpages">drupal.org/project/ghpages</a></h2>',frontmatter:{title:"New project: GitHub Pages for Drupal 7 (Also: I'm Git vetted!)",date:"March 10, 2013"}}},pathContext:{path:"content/new-project-github-pages-drupal-7-also-im-git-vetted"}}}});
